import React from 'react';
import { Link } from 'react-router-dom';

import UserNavbar from './UserNavbar';

// Import blood type icons from Material UI
import { BloodTypeAB, BloodTypeA, BloodTypeB, BloodTypeO } from '@mui/icons-material';

// Import FontAwesome icons
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHospital, faHeartbeat, faFlask } from '@fortawesome/free-solid-svg-icons';

const UserHome = () => {
  return (
    <>
    <UserNavbar/>
    <div className="container mx-auto px-4 py-16 flex flex-col justify-center items-center space-y-8">
      
      {/* Hero Section */}
      <div className="flex flex-col space-y-4 text-center">
        <h1 className="text-4xl font-bold text-red-500">Welcome to the Blood Donation System</h1>
        <p className="text-xl text-gray-700">
          Saving lives, one donation at a time.
        </p>  
      </div>
      
      {/* Blood Type Selection (Donors only) */}
      <div className="flex justify-center space-x-4 hidden md:flex">
      
        {/* Blood Type A */}
        <Link to="/donate-blood/A" className="flex flex-col items-center p-4 bg-white shadow-md rounded-lg hover:shadow-lg hover:bg-gray-100">
          <BloodTypeA className="text-red-500 text-4xl" />
          <span className="text-lg mt-2">Donate Blood Type A</span>
        </Link>
        
        {/* Blood Type B */}
        <Link to="/donate-blood/B" className="flex flex-col items-center p-4 bg-white shadow-md rounded-lg hover:shadow-lg hover:bg-gray-100">
          <BloodTypeB className="text-red-500 text-4xl" />
          <span className="text-lg mt-2">Donate Blood Type B</span>
        </Link>
        
        {/* Blood Type AB */}
        <Link to="/donate-blood/AB" className="flex flex-col items-center p-4 bg-white shadow-md rounded-lg hover:shadow-lg hover:bg-gray-100">
          <BloodTypeAB className="text-red-500 text-4xl" />
          <span className="text-lg mt-2">Donate Blood Type AB</span>
        </Link>
        
        {/* Blood Type O */}
        <Link to="/donate-blood/O" className="flex flex-col items-center p-4 bg-white shadow-md rounded-lg hover:shadow-lg hover:bg-gray-100">
          <BloodTypeO className="text-red-500 text-4xl" />
          <span className="text-lg mt-2">Donate Blood Type O</span>
        </Link>
        
      </div>
      
      {/* Call to Action Buttons */}
      <div className="flex flex-col space-y-4 md:flex md:space-y-0 md:space-x-4">
      
        {/* Become a Donor Button */}
        <Link to="/become-donor" className="btn btn-primary">
          <FontAwesomeIcon icon={faHospital} className="mr-2" /> Become a Donor
        </Link>
        
        {/* Request Blood Button */}
        <Link to="/request-blood" className="btn btn-outline">
          <FontAwesomeIcon icon={faHeartbeat} className="mr-2" /> Request Blood
        </Link>
        
      </div>
      
      {/* Additional Information Section */}
      <div className="flex flex-col space-y-4 text-center">
        <h2 className="text-2xl font-semibold text-gray-700">How Blood Donation Works</h2>
        <p className="text-lg text-gray-500">
          Click "Become a Donor" to learn more about the eligibility criteria and 
          donation process. If you need blood, click "Request Blood" to search
          for compatible donors.
        </p>
      </div>
      
      {/* Blood Bank Information Section */}
      <div className="flex flex-col space-y-2 text-center">
        <h2 className="text-2xl font-semibold text-gray-700">Find a Blood Bank</h2>
        <p className="text-lg text-gray-500">
          Search for blood banks in your area to find the nearest 
          location to donate blood or pick up blood requests.
        </p>
        <Link to="/blood-banks" className="btn btn-outline">
          <FontAwesomeIcon icon={faFlask} className="mr-2" /> Find a Blood Bank
        </Link>
      </div>
      
    </div>
    </>
  );
}

export default UserHome;
